import HHContext from '../Contexts'
import Main from '../Main'
import Modal from '../Modal'
import './App.css'

export default function App() {
	const {
		openModal
	} = useContext(HHContext)
	return (
		<>
			// Deploy our Main or our Modal
			{!openModal && (
				<Main />
			)}

			// Deploy our Main or our Modal
			{openModal && (
				<Modal>
					<Calendars />
				</Modal>
			)}
		</>
	)
}
